var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info hidden');
    this.update();
    return this._div;
};
  
info.update = function (props) {
    // console.log("info updating...");
    currentProps = props;
    var name = getName(props);
    var id = getId(props);
    var statsOptions = '';
    var disabled = '';
    if (typeof id == "undefined" ){
        id = entity;
    }
    // console.log(id);

    var fundingData = '';
    var serviceData = '';
    // console.log(name);
    
    data = "";
    if (typeof service == "undefined"){
        console.log("funding undefined")
    }
    if (typeof props !== "undefined"){
        for (var key in stats) {
            var selected = '';
            if (currentStat === key){
                selected = 'selected';
            }
            if (stats.hasOwnProperty(key)) {
                statsOptions += '<option ' + selected + '>' + key + '</option>';
            }
        }
        if (currentLayer == "rc"){
        	console.log(props.counties);
            data = props.counties.toString();
            data = '<div style="max-width:272px;"><b>Counties:</b><br />' + data.replace(/,/g,', ') + '</div>';

            fundingData = getFundingString("5311", props.counties);
            console.log(fundingData);
            // serviceData = getFundingString("5311", props.counties);
        }
        else if ((currentLayer === "senate" || currentLayer === "house" || currentLayer === "congress") && typeof geoLayers[currentLayer].counties !== "undefined") {
        	$('#'+currentLayer+'-name-select').val(name);
            console.log("getting funding string for district")
            counties = getCounties(geoLayers[currentLayer].counties[name]);
        	data = counties.toString();
            data = '<b>Counties:</b><br />' + data.replace(/,/g,', ');

            fundingData = getFundingString("5311", counties);
            // serviceData = getFundingString("5311", counties);
        }
        else if (currentLayer == "county"){
            fundingData = getFundingString("5311", [name]);
            // serviceData = getFundingString("5311", [name]);
            if(checkFunding("5310", name)){
                console.log("5310!");
                fundingData = "5310 in this county<br />" + fundingData;
            }
            if (checkMultipleFunding("5311", [name])[name].length === 0){
                disabled = 'disabled';
            }
        }
        
    }
    if (geoLayers.layers.indexOf(currentLayer) > -1){
        // setTimeOut(function(){
            // console.log(geoLayers[currentLayer].select)
            getSelect(currentLayer, id);
        // },1000)
    }
    // this._div.innerHTML = 
    $('#funding-content').html(fundingData);
    $('#service-content').html('<select class="form-control" id="stat-select" '+disabled+' onchange="toggleStat(this)">' + // style="position:absolute; right:8px; margin-top:6px;">' + 
                                        statsOptions +
                                '</select>' +
                                fundingData);
    $('#home-content').html();
    $('#info-content').html(data);

};

