function checkIntersect(district, set){
	var arr = [];
	var une = [];
	console.log(set.length);
	for (var i = set.length - 1; i >= 0; i--) {
		// console.log(set[i]);
		var intersect = turf.intersect(district, set[i]);
		// console.log(intersect);
		if (typeof intersect !== 'undefined' && intersect.geometry.type === "Polygon"){
			// arr.push(intersect);
			arr.push(getName(set[i].properties));
		}
		else if (typeof intersect !== 'undefined' && intersect.geometry.type === "MultiLineString"){
			// arr.push(intersect);
			arr.push({"borders": getName(set[i].properties)});
		}

		var union = turf.union(district, set[i]);
		if (typeof union !== 'undefined' && union.geometry.type === "Polygon"){
			une.push(getName(set[i].properties));
		}
		// var union = turf.union(district, set[i]);
		// if (typeof intersect !== 'undefined' && intersect.geometry.type === "Polygon"){
		// 	arr.push(getName(set[i].properties));
		// }
	}
	console.log(arr);
	console.log(une);
	return arr;

}

function addGeographies(geos, map){
    $.each(geos, function(i, geo){

        // Get county data for districts only 
    	if (isDistrict(geo.id)){
    		$.getJSON('data/bef/' + geo.id + '.json', function(data){
    			geoLayers[geo.id].counties = data;
    		});
    	}
        // Set up custom layer data with unique color
        var customLayer = L.geoJson(null, {
            style: function (feature) {
                return {
                    color: geo.color,
                    weight: 2,
                    // dashArray: '3',
                    opacity: 0.5
                };
            },
            id: geo.id,
            // 
            onEachFeature: function (feature, layer){
                                var props = feature.properties;
                                var id = getId(props);
                                var name = getName(props);
                                geoLayers[geo.id].select.geog.push([name, id]);
                                // console.log([name, id]);
                                if (geo.id === "senate" || geo.id === "house" || geo.id === "congress"){  //typeof props.DISTRICT !== "undefined" ){
                                    geoLayers[geo.id].select.name.push([toTitleCase(props.last) + ', ' + toTitleCase(props.first) + ' (' + props.party[0] + ')',props.DISTRICT]);
                                    // geoLayers[geo.id].select.name.push("blue")
                                }
                                var e;
                                if (typeof e == "undefined"){
                                    e = {};
                                }
                                
                                layer.bindLabel(getName(props), {noHide:true});
                                layer.on({
                                    mouseover: highlightFeature,
                                    mouseout: resetHighlight,
                                    click: zoomToFeature
                                });
                                if (entity !== "" && entity == getId(props)){
                                    map.fitBounds(L.geoJson(feature).getBounds());
                                    // info.update(props);
                                    currentProps = props;
                                    layer.setStyle({
                                            weight: '8',
                                            color: '#000',
                                            dashArray: '',
                                            opacity: 0.3
                                        });
                                    // geoLayers[currentLayer].data.resetStyle(ePrev.target)
                                    // zoom = layer;
                                    // previous = layer.feature.properties;
                                    ePrev.target = layer;
                                    // click = true;
                                }
                        },
            pointToLayer: function (feature, latlng) {

            }
        });
        
        geoLayers[geo.id].data = omnivore.topojson("data/topo/" + geo.id + ".json", null, customLayer)
        .on('ready', function(){
            if (geo.active == "active"){
                getSelect(geo.id, entity);
                if (entity !== "")
                    info.update(currentProps);
            }
            
        });
        console.log(geoLayers[geo.id].data);
        if (geo.active == "active"){
            console.log("adding data")
            geoLayers[geo.id].data.addTo(map);
            geojson = geoLayers[geo.id].data;
        }

    });
}
